import XCTest

/*
 
 Given a string s, find the length of the longest substring without repeating characters.


 */

class LongestSubstringWithoutRepeatingCharacters: XCTestCase {

    func test() {
//        Input: s = "abcabcbb"
//        Output: 3
//        Explanation: The answer is "abc", with the length of 3.
        
        
        let input = "abcdeafbdgcbb"

        // e
        // a
        // f
        // b
        // d
        //
        // a
        //
        // a
        //

//        let input = "au"
//        let final = naivelengthOfLongestSubstring(s: input)
        
        _ = optimizedLengthOfLongestSubstring(input)
        
        
        
    }
    
    /*
     
     TIME: -
     O(N3) in time there two are nested loops, and checking the uniqueness of a string is also a o(N) operation, which brings us to O(N3)


     O(N) operation, where N is the Set(inputString)'s count
          
     */
    
    func naivelengthOfLongestSubstring(s: String) -> Int {
        // our accumulated value
        var answer = 0

        for i in stride(from: 0, to: s.count, by: 1) {
            for j in stride(from: i + 1, to: s.count, by: 1) {
                let currentString = String(s[i...j])
                
                if currentString.isUnique {
                    answer = max(answer, currentString.count)
                }
            }
        }
        
        return answer
    }

    func lengthOfLongestSubstring(_ s: String) -> Int {
        guard !s.isEmpty else { return 0 }
        
        var answer = 1
        var i = 0
        var j = 1
        
        
        // while the answer can still increase
        while( i < s.count && j < s.count ) {
            let currentString = String(s[i...j])

            if currentString.isUnique {
                answer = max(answer, currentString.count)
                j += 1
            } else {
                i += 1
                j = i + 1
            }
        }
        
        return answer
    }
    
    func optimizedLengthOfLongestSubstring(_ s: String) -> Int {
        guard !s.isEmpty else { return 0 }
        
        var substringCache: [Character] = []
        var answer = 0
        s.forEach { character in
            
            defer { substringCache.append(character) }
            
            if substringCache.contains(character) {
                let currentCharacterIndex = substringCache.firstIndex(of: character)!
                answer = max(answer, substringCache.count)
                substringCache.removeSubrange(0...currentCharacterIndex)
                
            }
        }

        return max(answer, substringCache.count)
    }
}


// MARK: - convenience

extension StringProtocol {
    subscript(offset: Int) -> Character { self[index(startIndex, offsetBy: offset)] }
    subscript(range: ClosedRange<Int>) -> SubSequence {
        let startIndex = index(self.startIndex, offsetBy: range.lowerBound)
        let returned =  self[startIndex..<index(startIndex, offsetBy: range.count)]
        return returned
    }
}

extension String {
    var isUnique: Bool {
        var cache = Set<Character>()
        for i in stride(from: 0, to: count, by: 1) {
            let currentCharacter = self[i]

            if cache.contains(currentCharacter) {
                return false
            } else {
                cache.insert(currentCharacter)
            }
        }

        return true
    }
}


